/* Animation */
.anim-typewriter {
    animation: typewriter 5s steps(44) infinite normal both,
               blinkTextCursor 500ms steps(44) infinite normal;
  }
  
  @keyframes typewriter {
    0% { width: 0; }
    25% { width: 24em; }
    70% { width: 24em; }
    100% { width: 0; }
  }
  
  @keyframes blinkTextCursor {
    from { border-right-color: #f5f5f4; }
    to { border-right-color: transparent; }
  }

